import React from 'react';

const styles = {
  duoImage: {width: '30%'}
}

const buttonHandler = (e) => e.target.style.display = e.target.style.display == 'block' ? 'none' : 'block';

const GeneralPractice18 = () => (
  <div>
    <img src='boxA.gif' onClick={buttonHandler} style={styles.duoImage}></img>
    <img src='boxB.gif' onClick={buttonHandler} style={styles.duoImage}></img>
  </div>
);

export default GeneralPractice18;
